// Helper function for user API key rotation
let zeroxKeyIndex = 0;
function rotateUserApiKey0x(keys) {
    if (!Array.isArray(keys) || keys.length === 0) {
        return null;
    }
    const key = keys[zeroxKeyIndex % keys.length];
    zeroxKeyIndex = (zeroxKeyIndex + 1) % keys.length;
    return key;
}

